import { onGetAmplify } from "../../services/network";


let endpoints = {
  loadTransactionDetails: `http://localhost:3000//transaction-details/load-parent-details`
}

export default {
    loadTransactionDetails: () => {
        return onGetAmplify(endpoints.loadTransactionDetails);
    }
}
